お米の入替作業が面倒・・・。 o(≧▽≦)o<br>
それならそのまま入れてしまおう！！<br>
・・・というのがこの米びつです。<br>
<br>
袋の口は、本体に入れてからカットして下さいね♪
<br><br>
５キロ袋を縦方向にそのまま入れて保存できます。<br><br>
・引き出しやすい大型キャスター付き。<br><br>
・計量カップ付き（無洗米目盛り付き）<br><br>
・防虫剤付き（ケース付き）<br><br>
・フタの角度が固定できるストッパー付きで、<br>
　お米が取り出しやすい。<br>
<br>
○商品サイズ<br>
　 約 高さ305×横幅178×奥行270mm<br>
<br>
○容　量：７．６Ｌ<br>
<br>
≪品質表示≫<br>
フタ、本体、防虫剤ケース、計量カップ<br>
　　　　　ポリプロピレン／耐熱温度120度<br><br>
キャスター：ＡＢＳ樹脂／耐熱温度80度<br>
<br>【Made in Japan】
<BR>
<img src="http://image.rakuten.co.jp/casmin/cabinet/00534475/drf5_basic.jpg"><BR>
